import React from "react";
import { Graph } from "react-d3-graph";

const LineageGraph = ({ lineageData }) => {
    const graphConfig = {
        node: {
            color: "lightblue",
            size: 400,
            fontSize: 12,
        },
        link: {
            color: "gray",
        },
        directed: true,
    };

// Handle node click
const handleNodeClick = (nodeId) => {
    console.log("Node clicked:", nodeId);

    // You can perform actions here, for example:
    // 1. Navigate to the model's details page (if you have routing set up)
    // 2. Show more detailed information about the node

    alert(`You clicked on node: ${nodeId}`);  // Example of a simple action
};

    return (
        <div style={{ height: "600px", width: "100%" }}>
            {lineageData ? (
                <Graph
                    id="lineage-graph"
                    data={lineageData}
                    config={graphConfig}
                    onClickNode={handleNodeClick}
                />
            ) : (
                <p>Loading lineage graph...</p>
            )}
        </div>
    );
};

export default LineageGraph;
